['javascript:(function() {


    if(window.jQuery){
        var $ = window.jQuery;
        $("body").addClass("inapp android app-v1");
        
        $("a[href^=http]").click(function(e){
            var el = $(this);
            
            if(!/^https?:\/\/www.youth-incubation-centre.mo/i.test(el.attr("href"))){
                e.preventDefault();
                if(window.WebViewBridge){
                    window.WebViewBridge.send(el.attr("href"));
                }
            }
        });
    }
      
;
})();']

